import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles((theme)=>({
   appbar : {
       background:'#000'
   },

   toolbar:{
       justifyContent:'space-between'
   },
   typography:{
       cursor:'pointer',
       fontSize:'1.5rem',
       displayItems:'center',
       marginLeft:'24px',
       fontWeight:'bold'
   },
   iconbutton:{
       display:'block',
       position:'absoulte',
       top:'0',
       rigth:'0',
       transform:'translate(-100%,60%)',
       fontSize:'1.8rem',
   },
   menuicon:{
       color:'#fff'
   },
   list:{
       display:'flex',
       marginRight:'24px'

   },
   listitem:{
       cursor:'pointer',

       '&:hover':{
           borderButtom:'2px solid green'
       }
   }

}))

export  default useStyles
